The Chromebook Help Desk and Repair Center is open Mondays, Wednesdays, and Fridays from 9am - 11am at the back of
@WillinkTitans (just follow the signage to the walk-up window). Staff will be there throughout August to ensure students' Chromebooks are ready for school to start!
